  /**
   * This field allows you to define the standard number of hours available for this type of time period. For weekly and bi-weekly time periods, this number defaults to 40 and 80 hours respectively.
   * Note that making changes to the value will only impact timesheets created after the change has been saved, that is, it will not impact any existing timesheets (they will continue to have the previously defined 'hoursInPeriod' value).
   *
   * The value in this field will be used in the Dilution calculations (if your site is configured to use dilution), unless you have specified the Use Business Week Hours for Dilution (unatime.dilution_hours_from_business_week) property (which indicates dilution should be calculated based on business week hours).  Should you need to override the work hours for dilution purposes on existing timesheets, you can do so on a timesheet by timesheet basis.
   * @format double(13, 4)
   * @min 0
   * @exclusiveMin true
   * @example 123.45
   */
  hoursInPeriod: number | null;
  /**
   * This is field that can be used to limit the entry of future timesheets. By default, this field is not populated which equates to no limit. This field may be useful if you would like to prevent users from accidentally creating timesheets in a future period depending on your policy.
   *
   * This field's value represents the number of time periods allowed beyond the end date of the current time period (relative to today's date). This feature can be used alone or in conjunction with the 'cutOffDate' field as well as the 'TimePeriodModel.allowNewTimesheets' field to limit the entry of timesheets. This feature does not prevent Administrators from creating future time periods, but rather is only enforced where end users create new timesheets (thus, these restrictions do not impact Time Import or Time Populate administrative functionality).
   * @format int32
   * @min 1
   * @max 99
   */
