/**
 * Model representing timesheet search criteria.
 * * Search for active timesheets, by setting __active__ flag to _true_.
 * * Search for historical timesheets (not active), by setting __active__ flag to _false_,
 * * Omit the __active__ flag and alternatively specify a list of timesheet __statuses__ or __adjustmentStatus__ to include in list (which can be further filtered by __statusRange__ and adjustedStatusRange__).
 * * If search criteria include both __statuses__ and __adjustmentStatuses__, the result is an OR of the two criteria. For example, if criteria include a status of _EXTRACTED_ and adjustmentStatus of _SUBMITTED_, then search will look for timesheets that include either a status of _EXTRACTED_ or an adjustmentStatus of _SUBMITTED_.
 * * Likewise, if search criteria include both __statusRange__ and __adjustedStatusRange__, the result is an OR of the two criteria.
 * * Regardless of the above criteria settings, one can optionally specify the list of __personKeys__ by which to filter timesheets.
 * * __beginDateStart__ and __beginDateEnd__ can be used to filter timesheets by their beginDate. Alternatively, __workDate__ can be used to match any timesheet where workDate is within the timesheet's designated time period. If both __beginDateStart__ and __workDate__ are not specified, search will be limited to the last 30 days.
 */
export interface TimesheetSearchModel {
  active?: boolean | null;
  statuses?: TimesheetSearchModelStatusesEnum[] | null;
  adjustmentStatuses?: TimesheetSearchModelAdjustmentStatusesEnum[] | null;
  /**
   * beginDateStart/beginDateEnd allow searching by timesheet beginDate. Does not search Time Period dates. Default value is 30 days before current date
   * @format date
   * @pattern ^[1-2]\d{3}-\d{2}-\d{2}$
   */
  beginDateStart?: string | null;
  /**
   * full-date notation as defined by RFC 3339, section 5.6 with valid range from 1900-01-01 to 2099-12-31
   * @format date
   * @pattern ^[1-2]\d{3}-\d{2}-\d{2}$
   */
  beginDateEnd?: string | null;
  /**
   * Search for timesheets whose time period contains workDate
   * @format date
   * @pattern ^[1-2]\d{3}-\d{2}-\d{2}$
   */
  workDate?: string | null;
  /** A date/time range inclusive of rangeStart and rangeEnd */
  statusRange?: InstantRangeModel | null;
  /** A date/time range inclusive of rangeStart and rangeEnd */
  adjustedStatusRange?: InstantRangeModel | null;
  /** A date/time range inclusive of rangeStart and rangeEnd */
  lastUpdatedRange?: InstantRangeModel | null;
  /** Search for punch clock timesheets. */
  punchClockTimesheet?: boolean | null;
  /** Field on which to apply sort. Defaults to beginDate */
  sortBy?: TimesheetSearchModelSortByEnum | null;
  /** Order to apply for begin date sort. Defaults to ASC */
  sortOrder?: TimesheetSearchModelSortOrderEnum | null;
  personKeys?: number[] | null;
  /** Return only manager associations when the caller is an HR Administrator and a Manager. */
  managerOnly?: boolean | null;
  /** Return alternate associations when the caller is an HR Administrator and a Manager. */
  includeAlternates?: boolean | null;
  /** Search by alternate associations */
  alternateKeys?: number[] | null;
  /** Search for timesheets based on child dates */
  childDates?: TimesheetChildDateModel | null;
  /** Return only HR administrator associations. */
  hrAdminOnly?: boolean | null;
}

